    const [doctors,setDoctors]=useState([
        {
            doctorId:1,
            doctorName:"Sa"
        }
    ]);
  return (
    <>
        <PatientNavBar/>
        <h1>{id}</h1>
        <div>
            {
                doctors.map((doc)=>
                <h3>doc.doctorId</h3>

                )
            }
        </div>



    </>
  )
}

export default PatientAppointment
